import React from 'react'
function Signin() {
  return (
    <div>
    
      <center>
      <label>Enter Admin Email:</label><br/>
      <input type='email' required></input><br/>
      
      <label>Enter Password:</label><br/>
      <input type='password'></input><br/>

      <button onClick={Success()}>Login</button>
      </center>
    </div>
  )
}
function Success(){
    alert("Login Success")
}
export default Signin
